column2:
@liz_nft00 ありがとうございます！
そう言っていただけて安心しました😉
これからも素敵なストーリーをブロックチェーンに刻めればと思います✨

@liz_nft00 またお迎えさせてもらうとキャラに私の色が付いてしまうかと躊躇しましたが、素敵過ぎて我慢できませんでした😆
こちらこそ素敵な作品をありがとうございます✨
またよろしくお願いします！

@suzuyaky わざわざありがとうございます！
たまご+侍が刺さったため、お迎えさせてもらいました😁
これからも作品チェックさせてもらいます〜⭐

@Yo_mt27 ありがとうございます！
ちゃーろーさんの「#NFT買います」でお見かけして素敵だったので、横からお迎えさせてもらいました😉
今後もチェックさせてもらいますのでー⭐

@coinciana ありがとうございます！
デジタル作品を展示できるモニターなども充実しているようなので、環境を整えたらお願いにしにいきます😉
その時はよろしくお願いいたします！

@coinciana 隅々まで楽しませてもらってます😆
コレクションの展開とても楽しみです♪
他の方の顰蹙を買い過ぎない程度に今後も早押しやオークションに参加させていただきます！
